import React from "react";

const user = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <p>Age: {props.age}</p>
      <style jsx>
        {`
          div {
            border: 1px solid black;
            box-shadow: 0 2px 4px gray;
            padding: 15px;
            text-align: center;
          }
        `}
      </style>
    </div>
  );
};

export default user;
